import React from 'react';
import logo from "./assets/shared/logo.svg";
import { Link } from 'react-router-dom';
import { useState } from 'react';
import Navbar from './Navbar';



function Home() {
    const [isMobileOpen,setIsMobileOpen] = useState(false);
    
    function toggleMobileOpen (){
        setIsMobileOpen(!isMobileOpen);
    }

  return (
   
   <div className="home-background">
    <Navbar/>
    {/* <header className='home-header'>
        <div>
            <img src={logo} alt="logo" className='logo'/>
        </div>

        <button className='mobile-hamburger' aria-expanded={isMobileOpen}
        onClick={toggleMobileOpen}>
        </button>

        <nav>
            <ul className='main-navigation' data-visible={isMobileOpen?'true':'false'}>
                <li>
                <Link to="/"><span aria-hidden='true'>00</span>HOME</Link>
                </li>
                <li>
                <Link to="/Destination"><span aria-hidden='true'>01</span>DESTINATION</Link>
                </li>
                <li>
                <Link to="/Contact"><span aria-hidden='true'>02</span>CREW</Link>
                </li>
                <li>
                <Link to="/Technology"><span aria-hidden='true'>03</span>TECHNOLOGY</Link>
                </li>
                </ul>
        </nav>
    </header> */}
    <main className="home-content">
        <div className="home-text">
            <h5>SO, YOU WANT TO TRAVEL TO</h5>
            <h1>SPACE</h1>
            <p>Let’s face it; if you want to go to space, you might as well genuinely go to 
                outer space and not hover kind of on the edge of it. Well sit back, and relax 
                because we’ll give you a truly out of this world experience!</p>
        </div>
        <div className="home-button">
            <button className='home-btn'>EXPLORE</button>
        </div>
    </main>
   </div>
   
  )
}

export default Home;
